import {
    HomeIcon,
    UserIcon,
    CogIcon,
    UserCircleIcon,
    ShieldCheckIcon,
    LockOpenIcon,
    // DeviceMobileIcon,
  } from '@heroicons/react/24/solid';
// } from '@heroicons/react/outline';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

import { faHippo } from "@fortawesome/free-solid-svg-icons";


  
  export const sideMenu = [
    {
      label: 'Home',
      Icon: <FontAwesomeIcon icon={faHippo} />,
      to: '/home',
    },
    {
      label: 'Profile',
      Icon: UserIcon,
      to: '/profile',
    },
    {
      label: 'Master Data',
      Icon: CogIcon,
      to: '/settings',
      children: [
        {
          label: 'Psu',
          Icon: ShieldCheckIcon,
          to: 'security',
          children: [
            {
              label: 'Add',
              Icon: LockOpenIcon,
              to: 'credentials',
            },
            {
              label: 'List',
              Icon: UserIcon,
              to: '2fa',
            },
          ],
        },
      ],
    },
    {
      label: 'PSU Add',
      Icon: UserIcon,
      to: '/psu',
    },
    {
      label: 'Settings',
      Icon: CogIcon,
      to: '/settings',
      children: [
        {
          label: 'Account',
          Icon: UserCircleIcon,
          to: 'account',
        },
        {
          label: 'Security',
          Icon: ShieldCheckIcon,
          to: 'security',
          children: [
            {
              label: 'Credentials',
              Icon: LockOpenIcon,
              to: 'credentials',
            },
            {
              label: '2-FA',
              Icon: UserIcon,
              to: '2fa',
            },
          ],
        },
      ],
    },
  ];
